  {name: "Call of Duty: Black Ops III - Standard Edition - PlayStation 4", price: 59.88, description: "<b>INTRODUCING A NEW ERA OF BLACK OPS:</b>Call of Duty is a dark, gritty future where a new breed of Black Ops soldier emerges and the lines are blurred between our own humanity and the cutting-edge military robotics that define the future of combat.\n<b>A CALL OF DUTY CAMPAIGN UNLIKE ANYTHING BEFORE IT:</b> Treyarch elevates the Call of Duty social gaming experience by delivering a campaign with the ability to play cooperatively with up to four players online, using the same battle-tested network infrastructure and social systems that support its world-class Multiplayer and Zombies game modes.\n<b>PREPARE FOR A LEVELED-UP MULTIPLAYER</b> With Black Ops III, Treyarch premieres a new momentum-based chained-movement system, allowing players to fluidly move through the environment with finesse, using controlled thrust jumps, slides, and mantling abilities in a multitude of combinations, all while maintaining complete control over your weapon at all times.\n<b>FIGHT THE UNDEAD IN AN ALL-NEW HORROR STORY</b> No Treyarch title would be complete without its signature Zombies offering - a full-game experience with its own distinct storyline right out of the box. Black Ops 3 Zombies is the most immersive and ambitious Call of Duty Zombies to date, with a full XP-based progression system for players that adds depth and re-playability to the engaging gameplay Zombies fans have come to expect.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51pav59LVqL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Call-Duty-Black-Standard-Edition-PlayStation/dp/B00VU4J13W%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00VU4J13W", rating: 0.0, category: "Video Games"},
