g Whistle, just contact us and return it, and we will refund the FULL amount (we can also replace the whistle if there is an issue, at no cost to you).\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/411RMqK7hyL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Smarter-Pet%C2%AE-Premium-Whistle-Barking/dp/B00YB9YKFW%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00YB9YKFW", rating: 0.0, category: "Pet Products"},
