  {name: "WeatherBug", price: 0.0, description: "Spark Alerts - Unique and beautiful, Spark turns your smartphone into a personal lightning detector. Get exclusive real-time, minute-by-minute, mile-by-mile lightning proximity alerts from our network. Check out our live lightning map to see lightning strikes near and far!\nReal-Time Enhanced Pin-Point Forecasts for 2.6 Million Locations Worldwide - The most accurate current, extended and hourly weather forecasts for your neighborhood and beyond from the world's largest weather and lightning sensor networks.\nExclusive DTAs & Severe Weather Alerts - Minutes Matter. Our Dangerous Thunderstorm Alerts (DTAs) provide the fastest warnings to severe weather. Plus, get National Weather Service (NWS) warnings and watches to stay informed of severe weather conditions at all your current and saved locations.\nEnhanced Interactive Maps - Enjoy our enhanced maps with multiple layers such as Doppler radar, humidity, pressure, wind speed, high/low forecast, traffic, satellite imaging and more!\nExtended 10-Day Forecast - Weather happens. Get the most accurate extended forecast and Know BeforeTM 10 days ahead.\nLive Weather Cams - View live images from over 2,000 weather cameras across the U.S. to get a better picture (pun intended) of the weather at destinations near and far.\nLive Traffic Cams - Avoid traffic headaches. Our live traffic cams help you see driving conditions before you get jammed.\nKnow BeforeTM Messages - Messages will appear when we need to tell you something, from lightning in your area to new content.\nLifestyle Forecasts - Do I run outside or go to the gym? Should I cancel tomorrow's picnic? Our new Lifestyle Forecasts identify and analyze specific weather parameters to advise you on how best to stay comfortable and have fun!\nPhoto Section & Albums - We've collected magnificent photography from our users for your viewing pleasure. Now categorized into albums, finding awesome photos have never been quicker or easier! Come see what others are sharing and enjoy the scenery!\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51-1IDoF88L.png", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Earth-Networks-WeatherBug/dp/B009G9KFQ0%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB009G9KFQ0", rating: 0.0, category: "Mobile Application"},
